function start() {
    chooseLocale();
    if (settings.bonusForCoins) {
        Nodes.game.classList.add('use-coins');
        Nodes.shuffles.innerText = settings.cost.shuffles;
        Nodes.bombs.innerText = settings.cost.bombs;
        Nodes.teleports.innerText = settings.cost.teleports;
    }
    Nodes.coins.innerText = String(coins);
    ctx = Nodes.field.getContext('2d');

    loadImages(images, function () {
        addEventListeners();
        startLevel();
        animateGame();

        setTimeout(function () {
            Nodes.game.classList.remove('loading');
        }, 500);
    })
}

function startLevel() {
    var resetTimeout = tiles.length > 0 ? 500 : 0;
    if (tiles.length > 0) {
        blastArea(true);
    }
    score = 0;
    curScore = 0;
    Nodes.level.innerText = String(level + 1);
    shufflesLeft = levelConfig[level].shuffles;
    autoshufflesLeft = settings.autoshuffleNumber;
    bombsLeft = levelConfig[level].bombs;
    teleportsLeft = levelConfig[level].teleports;
    createField();
    Nodes.game.classList.remove('win', 'lose', 'super-win', 'no-shuffles', 'no-bombs', 'no-teleports');
    Nodes.game.classList.add('progress-reset');
    Nodes.gameProgress.style.width = '';
    setCounters();

    setTimeout(function () {
        Nodes.game.classList.remove('progress-reset');
        controlsDisabled = false;
    }, resetTimeout)
}

function createField() {
    var row, col;

    for (row = 0; row < levelConfig[level].rows; row++) {
        if (!tiles[row]) tiles[row] = [];
        for (col = 0; col < levelConfig[level].cols; col++) {
            tiles[row][col] = new Tile(row, col);
        }
    }
}

function resizeCanvas() {
    var row, col, isChecked;
    Nodes.field.width = 0;
    Nodes.field.height = 0;
    cw = Nodes.fieldContainer.getBoundingClientRect().width;
    tileWidth = cw / levelConfig[level].cols;
    tileHeight = tileWidth / 0.89;
    ch = tileHeight * levelConfig[level].rows;
    Nodes.field.width = cw;
    Nodes.field.height = ch;
    ctxBounds = Nodes.field.getBoundingClientRect();

    if (tiles.length > 0) {
        for (row = 0; row < levelConfig[level].rows; row++) {
            for (col = 0; col < levelConfig[level].cols; col++) {
                isChecked = tiles[row][col].isChecked;
                tiles[row][col] = new Tile(row, col, tiles[row][col].color, null, null, 1, tiles[row][col].booster);
                tiles[row][col].isChecked = isChecked;
            }
        }
    }
}

function loadImages(images, callback) {
    var src, imgLoaded = 0, imgCount = 0;
    for (src in images) {
        imgCount++;
    }
    for (src in images) {
        loadedImages[src] = new Image();
        loadedImages[src].onload = function () {
            if (++imgLoaded >= imgCount) {
                callback(images);
            }
            Nodes.loadingProgress.style.width = 100 / imgCount * imgLoaded + '%';
        };
        loadedImages[src].src = images[src];
    }
}

function addEventListeners() {
    window.addEventListener('resize', function () {
        resizeCanvas();
    });

    window.dispatchEvent(new Event('resize'));

    Nodes.field.addEventListener('click', function (e) {
        if (controlsDisabled) return;
        clickTile(e.clientX - ctxBounds.left, e.clientY - ctxBounds.top);
    })

    Nodes.pauseButton.addEventListener('click', function () {
        controlsDisabled = !controlsDisabled;
        Nodes.game.classList.toggle('paused');
        Sounds.button.play();
    })

    Nodes.nextButton.addEventListener('click', function () {
        level++;
        startLevel();
        Sounds.button.play();
    })
    Nodes.retryButton.addEventListener('click', function () {
        startLevel();
        Sounds.button.play();
    })
    Nodes.restartButton.addEventListener('click', function () {
        level = 0;
        if (settings.resetCoinsOnRestart) {
            coins = 0;
            updateCoins(0);
        }
        startLevel();
        Sounds.button.play();
    })
    Nodes.shuffleButton.addEventListener('click', function () {
        if (controlsDisabled) return;
        shuffleField();
        bombActive = false;
        Nodes.bombButton.classList.remove('active');
        teleportingTile = false;
        teleportActive = false;
        Nodes.teleportButton.classList.remove('active');
    })
    Nodes.bombButton.addEventListener('click', function () {
        if (controlsDisabled) return;
        bombActive = !bombActive;
        Nodes.bombButton.classList.toggle('active');
        teleportActive = false;
        if (teleportingTile) tiles[teleportingTile.row][teleportingTile.col].isChecked = false;
        teleportingTile = false;
        Nodes.teleportButton.classList.remove('active');
        Sounds.button.play();
    })
    Nodes.teleportButton.addEventListener('click', function () {
        if (controlsDisabled) return;
        if (teleportingTile) tiles[teleportingTile.row][teleportingTile.col].isChecked = false;
        teleportingTile = false;
        teleportActive = !teleportActive;
        Nodes.teleportButton.classList.toggle('active');
        bombActive = false;
        Nodes.bombButton.classList.remove('active');
        Sounds.button.play();
    })
}

function chooseLocale() {
    var lang, i, hasLocalization = true;

    if (!localization) {
        localization = {langs: ['en']};
        hasLocalization = false;
    }

    for (i = 0; i < settings.languages.length; i++) {
        lang = settings.languages[i].split('-')[0];
        if (!hasLocalization) {
            settings.locale = lang;
        }
        if (localization.langs.indexOf(lang) > -1) {
            settings.locale = lang;
        }
    }

    if (hasLocalization && (!settings.locale || localization.langs.indexOf(settings.locale) === -1)) {
        settings.locale = 'en';
    }

    Nodes.game.classList.add('locale-' + settings.locale);

    if (hasLocalization) translateNodes();
}

function translateNodes() {
    var i, elements, element;
    delete localization.langs;
    for (var key in localization) {
        if (localization.hasOwnProperty(key)) {
            elements = document.querySelectorAll('.translate-' + key);

            for (i = 0; i < elements.length; i++) {
                element = elements[i];

                if (element) {
                    element.innerText = localization[key][settings.locale];
                }
            }
        }
    }
}